SubmitRequest.submitGetData = function (page_name) {
  try {
    return fetch('/api/' + page_name, {
      method: 'GET'
    }).then(function (data) {
      return data.json();
    }).then(function (res) {
      if (!res.success) return {
        error: res.error.message || res.error
      };else return {
        success: res.success,
        data: res.data,
        loaded: true
      };
    });
  } catch (err) {
    return {
      success: false,
      error: err
    };
  }
};

